import Post from './Post';
import Comment from './Comment';

const Posts = (props) => {
    //  console.log(props.posts)

    return (
        <div>
            {props.posts.map((post) => {
                return (
                    <div>
                        <Post post={post} key={post.id} userId={props.userId} />
                        
                        {post.comments.map((comment) => {
                            return (
                                <div>
                                    <Comment />
                                </div>
                            );
                        })}
                    </div>
                );
            })}
        </div>
    );
};

export default Posts;
